import React, { useState } from 'react';


export default function SubHeader(props) {
    // Declare a new state variable, which we'll call "count"
    const [title, ToggleTitle] = useState(0);

    return (
       <div>
        <header className="bg-gray-700 shadow">
        <div className="max-w-7xl mx-auto py-6 px-4 sm:px-6 lg:px-8">
            <h1 className="text-3xl font-semibold leading-tight text-gray-100">
                {props.title[title]}
            </h1>
            <button onClick={() => ToggleTitle(SwitchTitle(title))}>
                Click me
            </button>
        </div>
        </header>
    <div className="flex bg-gray-200">
        <div className="flex-auto text-gray-700 text-center bg-gray-400 px-4 py-2 m-2">
            Short
        </div>
        <div className="flex-auto text-gray-700 text-center bg-gray-400 px-4 py-2 m-2">
            Medium length
        </div>
        <div className="flex-auto text-gray-700 text-center bg-gray-400 px-4 py-2 m-2">
            Significantly larger amount of content
        </div>
    </div>

       </div>


    );
}

function SwitchTitle(value){

    if (value == 0){
        value = 1;
    }
        else {
        value = 0
    }
        return value;


}
